[{"operationName":"semiPersonalizedRecommendationsQuery","variables":{"id":"people-who-viewed-converted-cdp-algo$course~uwDWjLu_EeWH_w6eDJDPoQ$no_attribute"},"query":"query semiPersonalizedRecommendationsQuery($id: String!) {
  SemiPersonalizedRecsModulesV1Resource {
    get(id: $id) {
      id
      entities {
        entityId
        __typename
      }
      courses {
        elements {
          s12ns {
            elements {
              id
              __typename
            }
            __typename
          }
          id
          slug
          name
          partnerIds
          photoUrl
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          courseTypeMetadata {
            courseTypeMetadata {
              ...RhymeProjectFragment
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      s12ns {
        elements {
          id
          name
          productVariant
          courses {
            paging {
              total
              __typename
            }
            __typename
          }
          logo
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          slug
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment RhymeProjectFragment on CourseTypeMetadataV1_rhymeProjectMember {
  ... on CourseTypeMetadataV1_rhymeProjectMember {
    rhymeProject {
      typeNameIndex
      __typename
    }
    __typename
  }
  __typename
}
"}]
